'use strict';
let PriceHistoryResponse = require('./PriceHistoryResponse.js');
class PriceHistoryResponseBuilder extends PriceHistoryResponse {
    setInstrument(instrument) {
        this.instrument = instrument;
    }
    setTimeframe(timeframe) {
        this.timeframe = timeframe;
    }
    setCount(count) {
        this.count = count;
    }
    addPriceHistory(data) {
        this.historyStorage.add(data);
    }
    setLastBarTime(lastBarDatetime) {
        this.lastBarDatetime = lastBarDatetime;
    }
    build() {
        return this;
    }
}
module.exports = PriceHistoryResponseBuilder
